	private final HdbSequenceModelElements pHdbSequenceModel;
	private final ListStringElements pListString;
	private final TerminalRule tBOOL;
	private final HdbSequenceElementsElements pHdbSequenceElements;
	
	private final Grammar grammar;
	
	private final TerminalsGrammarAccess gaTerminals;

	@Inject
	public HdbSequenceGrammarAccess(GrammarProvider grammarProvider,
			TerminalsGrammarAccess gaTerminals) {
		this.grammar = internalFindGrammar(grammarProvider);
		this.gaTerminals = gaTerminals;
		this.pHdbSequenceModel = new HdbSequenceModelElements();
		this.pListString = new ListStringElements();
		this.tBOOL = (TerminalRule) GrammarUtil.findRuleForName(getGrammar(), "com.sap.xsk.models.hdbsequence.HdbSequence.BOOL");
		this.pHdbSequenceElements = new HdbSequenceElementsElements();
	}
	
	protected Grammar internalFindGrammar(GrammarProvider grammarProvider) {
		Grammar grammar = grammarProvider.getGrammar(this);
		while (grammar != null) {
			if ("com.sap.xsk.models.hdbsequence.HdbSequence".equals(grammar.getName())) {
				return grammar;
			}
			List<Grammar> grammars = grammar.getUsedGrammars();
			if (!grammars.isEmpty()) {
				grammar = grammars.iterator().next();
			} else {
				return null;
			}
		}
		return grammar;
	}
	
	@Override
	public Grammar getGrammar() {
		return grammar;
	}
	
	
	public TerminalsGrammarAccess getTerminalsGrammarAccess() {
		return gaTerminals;
	}

	
